import React, { useState } from 'react';
import { signOut } from "firebase/auth";
import { auth } from '../firebase-config';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './UserDashboard.css';

function UserDashboard() {
  const [isUploading, setIsUploading] = useState(false);
  const [uploadMessage, setUploadMessage] = useState('');
  const navigate = useNavigate();

  const handleLogout = async () => {
    try {
      await signOut(auth);
      console.log("User signed out successfully");
      navigate('/');
    } catch (error) {
      console.error("Error signing out:", error.message);
    }
  };

  const goToAdminDashboard = () => {
    navigate('/AdminDashboard');
  };

  const handleVideoUpload = async (videoFile) => {
    setIsUploading(true);
    setUploadMessage(''); // Clear previous messages
    const formData = new FormData();
    formData.append('file', videoFile);

    try {
      const response = await axios({
        method: 'POST',
        url: 'https://detect.roboflow.com/brown-trout-counter/2', // Replace with your actual endpoint
        params: {
          api_key: 'hrHXV6QIsOWhUf9XSJ5F' // Replace with your actual API key
        },
        data: formData,
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });

      console.log(response.data);
      setUploadMessage('Upload successful! Processing complete.'); // Set a success message
    } catch (error) {
    // Enhanced error logging
    if (error.response) {
      // The request was made and the server responded with a status code
      // that falls out of the range of 2xx
      console.error("Data:", error.response.data);
      console.error("Status:", error.response.status);
      console.error("Headers:", error.response.headers);
      setUploadMessage(`Upload failed: ${error.response.data.message}`); // Use server's response message
    } else if (error.request) {
      // The request was made but no response was received
      console.error("Request:", error.request);
      setUploadMessage("Upload failed: No response from the server.");
    } else {
      // Something happened in setting up the request that triggered an Error
      console.error("Error message:", error.message);
      setUploadMessage("Upload failed: Request setup error.");
    }
  } finally {
    setIsUploading(false);
  }
};

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <img src={`${process.env.PUBLIC_URL}/h2logo.png`} className="App-logo" alt="H2Overwatch Logo" />
        <h1>Welcome to the User Dashboard</h1>
      </div>
      <div className="dashboard-content">
        <p>Analytics</p>
        <input type="file" onChange={handleFileSelect} accept="video/*" />
        {isUploading && <p>Uploading and processing video...</p>}
        {uploadMessage && <p>{uploadMessage}</p>}
      </div>
      <div className="dashboard-menu">
        <ul>
          <li>Count Fish</li>
          <li>Environmental Data</li>
          <li>Database</li>
          <li><button onClick={goToAdminDashboard}>Admin Dashboard</button></li>
        </ul>
      </div>
      <div className="dashboard-footer">
        <button onClick={handleLogout}>Log Out</button>
      </div>
    </div>
  );
}

export default UserDashboard;
